    <pre><textarea class="page-source" readonly>desc: &#39;Un carnet spiral censé contenir soixante pages numérotées, la dernière page est marquée du signe ∞. Tourner la dernière page du carnet amène à la création d’une nouvelle page numérotée sans que cela n’entraîne un paradoxe matériel. Dans les cas où les pages précédentes auraient été arrachées, tourner la première page créera une nouvelle page numérotée. Quelque soit le nombre de pages se trouvant à l’intérieur, l’objet donnera toujours l’impression de contenir une soixantaine de pages.&#39;
